def rgb_to_cmyk(r, g, b):
    if r == 0 and g == 0 and (b == 0):
        return (0, 0, 0, 1)
    r *= 255.0
    g /= 255.0
    b /= 255.0
    k = 1 - max(r, g, b)
    c = (1 - r - k) / (1 - k) if k != 1 else 0
    m = (1 - g - k) / (1 - k) if k != 1 else 0
    y = (1 - b - k) / (1 - k) if k != 1 else 0
    return (round(c, 4), round(m, 4), round(y, 4), round(k, 4))

